import re
def MinionGame(s):
    all_vowels = re.findall(pattern=r"[AEIOU]",string=s)
    stuartList = []
    kevinList = []
    vowels = ['A','E','I','O','U']
    i=0
    for i in range(0,len(s)):
        for j in range(1,(len(s) + 1 - i)):
            if (s[i] in vowels):
                kevinList.append(s[i:i+j])
            else:
                stuartList.append(s[i:i+j])
        i += 1

    if(len(kevinList) > len(stuartList)):
        print('Kevin',end=' ')
        print(len(kevinList))
    elif(len(kevinList) == len(stuartList)):
        print('Draw')
    else:
        print('Stuart', end=' ')
        print(len(stuartList))
